// src/Home.js
import React from 'react';
import Game from './Game';

const Home = () => {
  const [startGame, setStartGame] = React.useState(false);

  return (
    <div>
      {startGame ? (
        <Game />
      ) : (
        <div>
          <h1>¡Bienvenida a tu juego!</h1>
          <h1>Tienes que contestar una serie de preguntas.</h1>
          <h1>A medida que vayas acertando, se ira aclarando una imagen.</h1>
          <h1>Finalmente tendrás que decir </h1>
          <button onClick={() => setStartGame(true)}>Iniciar Juego</button>
        </div>
      )}
    </div>
  );
};

export default Home;
